		<Layout>
			{products.lenght
				? product.map((product) => <Product product={product} />)
				: ""}
			;
		</Layout>
	);
};

Index.getInitialProps = async () => {
	const res = await fetch(`${clientConfig.Siteurl}/getProducts`);
	const productsData = await res.json();
	return {
		products: productsData,
	};
};
export default Index;
